package peer

import (
	"encoding/hex"
	"testing"

	"github.com/pion/rtp"
)

func TestRtp(t *testing.T) {
	raw := ``
	rawB, e := hex.DecodeString(raw)
	t.Log(e)
	t.Log(len(rawB))
	h := rtp.Header{}
	_, err := h.Unmarshal(rawB)
	if err != nil {
		t.Fatal("err should be nil, but:", err)
	}
	t.Log(h)
}
